$(document).ready(function () {
	NAV.listeners();
	if ($(document).width() > 640) {
		$(document).scroll(function () {
			NAV.scrollEvents();
		});
	}
	if ($(window).scrollTop() >= NAV.desktopMenu.height() && $(document).width() > 640) {
		$(NAV.desktopMenu).hide();
	}
});
